import movies from "../movies.json";
import { MovieCard } from "./MovieCard";
import styles from "../styles/Movies"
export function MoviesGrid() {
    console.log(movies);
    return (
        <ul>
            {movies.map((movie, poster_pad) => (
                <MovieCard key={movie.id} movie={movie}/>
            ))}
        </ul>
    );
}
